import React from 'react';
import TwitterFeed from './TwitterFeed';
import MALFeed from './MALFeed';
import GoodreadsFeed from './GoodreadsFeed';
import SteamFeed from './SteamFeed';
import './FeedSection.css';

function FeedSection() {
  return (
    <section id="feeds" className="feed-section">
      <h2>Live Feeds</h2>
      <div className="feeds-grid">
        <div className="feed-wrapper twitter-wrapper">
          <TwitterFeed />
        </div>
        <div className="feed-wrapper mal-wrapper">
          <MALFeed />
        </div>
        <div className="feed-wrapper goodreads-wrapper">
          <GoodreadsFeed />
        </div>
        <div className="feed-wrapper steam-wrapper">
          <SteamFeed />
        </div>
      </div>
    </section>
  );
}

export default FeedSection;
